window.bookSummaryJSON = "<p><i>Laurent and the Beast</i>: Disfigured by a fire, Beast has wrapped himself in a tight cocoon of violence and mayhem where no one can reach him. Until one night when he meets Laurent.</p> <p><i>My Dark Knight</i>: Newly single, Knight is done with relationships. All he's interested in is bringing down The Count, an internet personality who is tarnishing his family name. But when Knight meets Elliot, the man behind The Count, he no longer knows what to do with him.</p> <p><i>On Your Knees, Prospect</i>: For two years Jake's toiled as the Kings of Hell MC's only prospect. So when a new guy swans in and thinks he'll get a patch in no time, Jake is there to stand in his way. Only the guy is older, more experienced, drives a Harley, and has the kind of boots Jake craves to lick. </p> <p><i>Gray's Shadow</i>: Following a fire that left him without one arm, Gray feels pushed to the sidelines. In order to prove to his club that he is still capable of completing dangerous tasks, he will have to team up with the strange creature from the Other Side.</p> <p><i>In the Arms of the Beast</i>: With the world on the brink of collapse, Laurent and Beast will have to put their differences aside to stand a chance at saving their family.</p> <p>Contains mature themes.</p>"; 
